import Link from "next/link";
import useSWR from "swr";

const fetcher = url => fetch(url).then(r => r.json());

export default function Index() {
  const { data, error } = useSWR("/api/taest", fetcher);
  const text = data ? data.text : "Loading...";
  const author = data ? data.author : "Loading...";
  return (
    <>
      <h1>Text: {text}</h1>
      <h2>Author: {author}</h2>
      <Link href="/about">
        <a>Go to About!</a>
      </Link>
    </>
  );
}
